import React from 'react';
import Header from './components/Header';
import Card from './components/Card';
import Form from './components/Form';

function App() {
    const cardsData = [
        { title: 'Card Title 1', content: 'This is the content for the first card. It\'s a great place to put some information.' },
        { title: 'Card Title 2', content: 'Here is some different content for the second card. You can use this for various purposes.' },
        { title: 'Card Title 3', content: 'A third card with some more text. This demonstrates how to reuse the Card component.' },
    ];

    return ( <
        div className = "bg-gray-100 min-h-screen font-sans antialiased text-gray-800" >
        <
        Header / >
        <
        main className = "container mx-auto p-4 md:p-8" >
        <
        h2 className = "text-3xl font-bold text-center text-gray-900 mb-8" > Featured Items < /h2> <
        div className = "grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 mb-12" > {
            cardsData.map((card, index) => ( <
                Card key = { index }
                title = { card.title }
                content = { card.content }
                />
            ))
        } <
        /div>

        <
        h2 className = "text-3xl font-bold text-center text-gray-900 mb-8" > Contact Us < /h2> <
        div className = "max-w-xl mx-auto" >
        <
        Form / >
        <
        /div> <
        /main> <
        /div>
    );
}

export default App;
